import React from 'react';

function NameListRendering(props) {
    const nameArray = ["Azhar", "Adeel", "Wasif", "Adil"]
    return (
        <div>
            {
                nameArray.map(name => <h4>{name}</h4>)
            }
        </div>
    );
}

export default NameListRendering;
